webpackJsonp([0xb3832b57ed7e],{4226:function(e,o){e.exports={data:{markdownRemark:{html:'<h2>Chrome Firefox Development Tools</h2>\n<p>Chrome and Firefox Developer tools assist web developers in analyzing the HTML, CSS and Javascript on a web page. They are useful for debugging, optimizing code, inspecting elements and much more.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li><strong>Page Inspector:</strong>  View and edit page content and layout.</li>\n<li><strong>Web Console:</strong>  See javascript console.log() messages and erros</li>\n<li><strong>JavaScript Debugger:</strong>  View and modify JavaScript running on a page</li>\n<li><strong>Network Monitor:</strong>  See network requests made when pages are loaded</li>\n<li><strong>Performance Tools:</strong>  Analyze computer resources used by the site</li>\n</ul>\n<h3>Accessing the development tools</h3>\n<ol>\n<li>In the menu bar at the top of the screen select View > Developer > Developer Tools. The tools will appear on the bottom, side, or as a pop-out window.</li>\n<li>On a web page right click on an element. When the menu appears select ‘Inspect’.</li>\n</ol>\n<h3>More Information:</h3>\n<ul>\n<li><a href="https://developer.chrome.com/devtools">Chrome DevTools</a></li>\n<li><a href="https://developer.mozilla.org/en-US/docs/Tools">Firefox Developer Tools</a></li>\n</ul>',fields:{slug:"/developer-tools/developer-tools-in-browsers/chrome-developer-tools/"},frontmatter:{title:"Chrome Developer Tools"}}},pathContext:{slug:"/developer-tools/developer-tools-in-browsers/chrome-developer-tools/"}}}});
